export const listTheme = {
    root: {
        base: 'space-y-1 text-gray-500 list-inside dark:text-gray-400',
        ordered: {
            off: 'list-disc',
            on: 'list-decimal',
        },
        horizontal: 'flex flex-wrap items-center space-x-4 space-y-0 justify-center list-none',
        unstyled: 'list-none',
        nested: 'ps-5 mt-2',
    },
};
